class GridImage extends StatefulWidget {
  const GridImage({Key? key}) : super(key: key);

  @override
  _GridImageState createState() => _GridImageState();
}

class _GridImageState extends State<GridImage> {
  List<Image> images = [];
  add(){
    images.add(Image("data:image/jpeg;base64,", "Game Of Thrones"));
    images.add(Image("data:image/jpeg;base64,", "Lost"));
    images.add(Image("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSvbiF-EkXhEnepjiO-2bNnCQKxjAH3yA6Pkg&usqp=CAU", "Breaking Bad"));
    images.add(Image("data:image/jpeg;base64,", "Friends"));
    images.add(Image("data:image/jpeg;base64,", "The Office"));
    images.add(Image("data:image/jpeg;base64,", "The Big Bang Theory"));
    images.add(Image("data:image/jpeg;base64,", "WestWorld"));
    images.add(Image("data:image/jpeg;base64,", "Attack On Titan"));
    images.add(Image("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ4TaFdMs7WKwucg2wRbnftPYTxfKeNIAWfdA&usqp=CAU", "Banshee"));
    images.add(Image("data:image/jpeg;base64,", "Sherlock"));
  }
  @override
  void initState() {
    // TODO: implement initState
    super.initState();
    add();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: GridView.builder(gridDelegate: const SliverGridDelegateWithMaxCrossAxisExtent(maxCrossAxisExtent: 200,
          childAspectRatio: 3/2,
          crossAxisSpacing: 20,
          mainAxisSpacing: 20
      ),
          itemCount: images.length,
          itemBuilder: (BuildContext ctx, index){
        return Container(
          decoration: BoxDecoration(shape: BoxShape.circle),
          child: ClipRRect(borderRadius: BorderRadius.all(Radius.circular(10)),
          child: Image.network(images[index].image, height: 100,width: 100, fit:BoxFit.fill),),

        );
          }
      ),
    );
  }
}

class Image{
  String image;
  String name;
  Image(this.image, this.name);
}
